Chart.register(...registerables, ChartDataLabels);


export function GaugeChart({data, options}) {
    return <div style={{height: '100%', aspectRatio: 1, display: 'flex', justifyContent: 'center', marginBottom: '100px'}}>
        <GoogleChart
            chartType="Gauge"
            data={data}
            options={options}
        />
    </div>
}

