export function DesignedGaugePin({data, min, max}) {
    // Rotate the pin according to the data
    const offset = 72;
    const angle = (data - min) / (max - min) * 180 - offset;
    const pointerStyle = {
        transformOrigin: '80% 100%',
        height: '227.45px',
        top: '67px',
        position: 'absolute',
        width: '91.29px',
        left: '230px',
        transform:` rotate(${angle}deg)`,
    }
    return <div>
        {/* The pin */}
        <div style={pointerStyle}>
            <img className="_idGenObjectAttribute-1 _idGenObjectAttribute-2"
                 src="data:image/png;base64,"
                 alt=""
            />
        </div>
        {/* Pin head */}
        <div id="_idContainer076" className="_idGenObjectStyle-Disabled">
            <img className="_idGenObjectAttribute-1 _idGenObjectAttribute-2"
                 src="data:image/png;base64,"
                 alt=""
                 style={{scale: '130%'}}
            />
        </div>
    </div>
}


export function DesignedGaugeChart({data, min, max}) {
    return <div style={{display: 'flex', scale: '50%'}}>
        <DesignedGaugeBackground/>
        <DesignedGaugePin data={data} min={min} max={max}/>
    </div>
}
